import './App.css';
import Navbar from './components/Navbar';
import Footer from './components/Footer'
import React from 'react';
import {BrowserRouter as Router,Rout,Routes} from 'react-router-dom';
import Home from './components/pages';

function App() {
  return (
    <div className="App">
      <Router>
      <Navbar/>
      <Routes></Routes>
      <Footer/>
      </Router>
    </div>
  );
}

export default App;
